import React from "react";
import link from "react-router-dom";

function AppHeader() {
  return (
    <nav>
        <link to="/">Logo</link>
      <ul>
        <li>
          <link to="/about"> About </link>
        </li>

        <li>
          <link to="/calendar"> Calendar </link>
        </li>

        <li>
          <link to="/contact"> Contact </link>
        </li>
      </ul>
    </nav>
  );
}


export default AppHeader
